    let proteins: Float
    let carbs: Float
    let fats: Float
    let servingSize: String
    let weightGrams: Int
    
    func toFoodEntry() -> FoodEntry {
        FoodEntry(
            name: name,
            calories: calories,
            fats: fats,
            proteins: proteins,
            carbs: carbs,
            emoji: emoji,
            weightGrams: weightGrams,
            source: .search
        )
    }
}

